{
  "name": "Members of Parliament and Provincial Assemblies (Exemption of Advisers from Disqualification) Act, 1976",
  "date": "18th April, 1976",
  "tagline": "An Act to declare the holders of the office of Adviser to the Governor not to be disqualified from being elected or chosen as, and from being a member of Parliament or a Provincial Assembly."
}
